    @Test
    void testProtoBuffPut() {
        LostInfo build = LostInfo.builder()
                .schoolId("3118007452")
                .title("23333333")
                .build();
        Schema<LostInfo> schema = RuntimeSchema.getSchema(LostInfo.class);
        LinkedBuffer buffer = LinkedBuffer.allocate(512);

        // ser
        final byte[] protostuff;
        try {
            protostuff = ProtostuffIOUtil.toByteArray(build, schema, buffer);
        } finally {
            buffer.clear();
        }
        redisTemplate.execute((RedisCallback<Void>) connection -> {
            connection.set("key".getBytes(), protostuff);
            return null;
        });
    }

    @Test
    void testProtoBuffGet() {
        Schema<LostInfo> schema = RuntimeSchema.getSchema(LostInfo.class);
        LostInfo lostInfo = schema.newMessage();
        byte[] protostuff = redisTemplate.execute((RedisCallback<byte[]>) connection -> connection.get("key1".getBytes()));
        if (protostuff != null) {
            ProtostuffIOUtil.mergeFrom(protostuff, lostInfo, schema);
        }
        System.out.println(lostInfo);
    }

